    if title_font_size: title_style = f"font-size: {title_font_size};"
    else: title_style = f"font-size: clamp(calc(2.5rem * {font_size_multiplier}), calc((4vw + 1rem) * {font_size_multiplier}), calc(4rem * {font_size_multiplier}));"
